import React from 'react';
import PropTypes from 'prop-types';
import {Panel, PanelHeader, Button, CellButton, Group, Cell, Div, Avatar, Header, PanelHeaderButton} from '@vkontakte/vkui';
import "@vkontakte/vkui/dist/vkui.css";


import Icon24Add from '@vkontakte/icons/dist/24/add';
import Icon28GhostOutline from '@vkontakte/icons/dist/28/ghost_outline';
import Icon24Attachments from '@vkontakte/icons/dist/24/attachments';
import Icon24Settings from '@vkontakte/icons/dist/24/settings';

const Home = ({ id, go, fetchedUser }) => (
	<Panel id={id}>
		<PanelHeader left={<PanelHeaderButton onClick={go} data-to="home"/>}>Каталог скинов</PanelHeader>
		{fetchedUser &&
		<Group title="User Data Fetched with VK Bridge">
			<Cell
				before={fetchedUser.photo_200 ? <Avatar src={fetchedUser.photo_200}/> : null}
				description={fetchedUser.city && fetchedUser.city.title ? fetchedUser.city.title : ''}
			>
				{`${fetchedUser.first_name} ${fetchedUser.last_name}`}
			</Cell>
		</Group>}

		<Group title="Navigation Example">
			<Div>
				<Button size="xl" level="2" onClick={go} data-to="persik">
					Show me the Persik, please
				</Button>
			</Div>
		</Group>
    <Group header={<Header mode="secondary">Выберите категорию</Header>}>
      <CellButton onClick={go} data-to="def_skins" before={<Icon24Add />}>Обычные скины</CellButton>
      <CellButton before={<Icon28GhostOutline width={24} height={24} />}>Питомцы</CellButton>
      <CellButton before={<Icon24Add />}>Частицы</CellButton>
      <CellButton before={<Icon24Attachments />}>Собственный фон</CellButton>
    </Group>
	</Panel>
);

Home.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
	fetchedUser: PropTypes.shape({
		photo_200: PropTypes.string,
		first_name: PropTypes.string,
		last_name: PropTypes.string,
		city: PropTypes.shape({
			title: PropTypes.string,
		}),
	}),
};

export default Home;
